import React from 'react';
import {
    ChakraProvider,
    Box,
    Text,
    Link,
    VStack,
    Code,
    Grid,
    theme,
    Container,
    Flex,
    Center,
    Square
} from '@chakra-ui/react';

const LandingPage = () => {
    return (
        <Container maxW='container.lg' bg='pink' color='#262626'>
            <Flex color='white'>
                <Box flex='1' bg='white' minHeight='5vh' color='black' justifyContent={'end'} >
                    <Text
                        color='gray.500'
                        lineHeight={{ 'sm': '8vh', 'md': '9vh' }}
                        align='initial'
                        fontSize={{ 'sm': '36', 'md': '48' }}
                    //bgColor={'blue'}
                    >
                        I am
                    </Text>
                    <Text lineHeight={{ 'sm': '7vh', 'md': '8vh' }} align='initial' fontSize={{ 'sm': '36', 'md': '48' }} fontWeight={700} bgColor='green.200'>Samuel YAKOBUS</Text>
                </Box>
                <Box flex='1' bg='tomato'>
                    <Text>Box 2</Text>
                </Box>
            </Flex>
        </Container >

    );
}

export default LandingPage;
